import { createMuiTheme } from '@material-ui/core/styles';

export const mainTheme = createMuiTheme({
    palette: {
      primary: {
        main: "#1B2430",
        light: "#232F3E",
        dark: "#01002D"
      },
      secondary: {
        main: "#E4E4E4",
        light: "#FFFFFF",
        dark: "#494949"
      },
    },
  });
